const About = () => {
  const Services = ['html', 'css', 'javascript', 'reactjs', 'java'];
  const serv = Services.map((webservices) =>
    <li key={webservices.toString()}>
      {number}
    </li>
  );
  return (
    <>  
    <h3>About Us</h3>  
    <li>{serv}</li>
    </>
  )
}

export default About
